text:
Diml innehller en egen definition av datatyper mellan olika kll- och destinationssystem.
Datatyper anges p t.ex. kolumner p fljande stt;
Observera att Diml gr skillnad mellan versaler och germaner och att datatypen som anges i id-fltet fr dimlDataType skall vara det som anges i Id-kolumnen ovan.
Shr definieras t.ex. en integer;
Typen string r en sekvens av tecken och kan innehlla bde siffror, bokstver och specialtecken.
Tillgngliga attribut;
Typen integer r ett heltal som beroende p om det kan vara negativt eller ej (isUnsigned) och antal bitar (bits) representerar ett tal med ett givet intervall.
